import React from 'react';
import './Film.css';

const Film = (props) => {
    return(
        <div className='Film'>
            <div className="Film-header">
                <h4 className='Film-name'>{props.film.name}</h4>
                <p className='Film-genres'>{props.film.genres}</p>
                <p className='Film-release'>{props.film.releaseDay}</p>
            </div>
            <div className='Film-information'>
                <p className='Description'>{props.film.description}</p>
                <p className='Rating'>{props.film.rating}</p>
            </div>
        </div>
    );
}

export default Film;
